import Head from 'next/head'
import React from "react";
import axios from "axios";
import { useRouter } from 'next/router'
import { render } from 'react-dom';

function Post ()  {

    const handleClick = (e) => {
        e.preventDefault()
        router.push('/blog/')
    }

    

    const router = useRouter();
    var { id } = router.query
    var y = router.query
    y = JSON.stringify(y)
    let x = JSON.stringify({id});
    var key = Object.keys({id});
    console.log("KEYS: ", Object.keys({id}));
    console.log("VALUES: ", Object.values(y));
    console.log("ENTRIES: ", Object.entries(x));

    let values = Object.values(x);
    console.log("TEST: ", values)

    

   
    console.log("ROUTE: ", key);

    
    const createPost = postConst(key);

    return {
        createPost
    }
    };


   function postConst({ param }) {


        return (
            <>
                <Head>
                    <title>Blog Post: { param } </title>
                    <meta name="viewport" content="initial-scale=1.0, width=device-width"/>
                </Head>
                <button onClick={handleClick}>Go Back</button>
                <div>Blog Post { param } Details:</div>
    
            <div>
                    <div>
                        Title: { param }
                        <div>
                            By:
                        </div>
                    </div>
                <div>
                    Body:
                </div>
    
            </div>
    
            <button onClick={handleClick}>AuthorDetails</button>
            </>
            )
    }   
    
  async function getPostData(key) {
        axios.get(`https://jsonplaceholder.typicode.com/posts/${key}`) 
        .then((response) => {
            const postData = response.data;
            this.setState({ postData })
        })
        .catch(console.log)    
        return {
            postData
        } 
    }

    
export default Post;
